import React from 'react';
import Header from './Header';

function Register() {
    return (
        <div className="Register">
            <form className="popup__form" onSubmit>
                <h2 className="popup__title">Регистрация</h2>
                <input
                type="email"
                required
                className="popup__input popup__input_name_title"
                placeholder="Email"
                // onChange={}
                />
                <input
                type="password"
                required
                className="popup__input popup__input_name_title"
                placeholder="Пароль"
                // onChange={}
                />
                <button type = "submit" className="popup__save">Зарегистрироваться</button>                  
            </form>  

        </div>
    )
}
    
export default Register;
